import logo from './logo.svg';
import './App.css';

function App() {
  return (
    document.style = 'background: red;',
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <h1>Hello There</h1>
    </div>
  );
}

export default App;
